import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);

const styles = {
  container: {
    fontFamily: "Avenir-Book, sans-serif",
    margin: "0 auto",
    maxWidth: 1200,
    padding: "1rem",
    fontSize: 45
  },
  header: {
    textAlign: "center",
    fontFamily: "Avenir-Book, sans-serif",
  }
};
